import React from "react";
import myData from "./db.json";
import Home from "./Components/Home";

const Dummy = () => {
  const total = myData.details[0];
  return (
    <div>
      {total.map((det) => (
        <div key={det.id}>
          <Home totals={det} />
        </div>
      ))}
    </div>
  );
};

export default Dummy;
